export const KETQUA_ROUTER = {
    path: '/ketqua',
    roles: [],
    childrens: {
      listUser: {
        path: '/ketqua/list',
        roles: [],
      },
      createUser: {
        path: '/ketqua/create',
        roles: [],
      },
      updateUser: {
        path: '/ketqua/:id',
        buildPath: (id: any) => `/ketqua/${id}`,
      }
    }
  };
